const Navbar = () => {
  return (
    <div>
      <nav className="sidebar">
        <img
          className="mainimg"
          alt="로고"
          src="/Users/gim-yeongchan/교외/Farm/mainpage/src/asset/Clinic.png"
        />
        <h1>Dr.이리로</h1>
        <ul>
          <li>홈페이지</li>
          <li>환자 관리</li>
          <li>프로필 관리</li>
        </ul>
      </nav>
    </div>
  );
};

export default Navbar;
